(1, '2017-01-02 11:00:00', 'Foi o meu irmão quem me enganou. Ele colocou a fita azul na linguiça a noite e eu só vi de manhã.', 'CONPREI UMA LINGUICA E ELA VEIO AZUL.', 1),
(2, '2017-01-02 11:00:01', 'Eu consegui trocar na loja, etão não é mais necessario está reclamação.', 'CONPREI UM SAPATO E ELE VEIO CON BORACOS NA SOLA.', 2),
(3, '2017-01-06 11:00:02', 'Eu conversei CON o gerente e ele me pediu desculpas pela atitude do funcionario e garantiu que não aconteceria mais.', 'ME TRATARAM MAL.', 3),
(4, '2017-01-08 11:00:03', 'O funcionario teve varias r4eclamações parecidas e foi demitido.', 'FUI ATENDIDA POR UMA FUNCIONARIA SEM EDUCAÇÃO.', 4),
(5, '2017-01-20 11:00:04', 'Eu reclamei CON o Procon e recebi meu dinheiro de volta. E uma pizza nova :)', 'MANDARAM MINHA PIZZA VENCIDA.', 5),
(6, '2017-01-23 11:00:05', 'Eu tava só testando o site kkkk mals ae ', 'ME VENDERAM UMA LATA DE DOLLY, MAIS NÃO EXISTE LATA DE DOLLY.', 6),
(7, '2017-02-06 11:00:06', 'Eu falei CON a vendedora da loja e ela me disse que era azul mesmo porque ele é do tipo gorgonzola. ', 'CONPREI UM QUEIJO E ELE VEIO AZUL.', 7),
(8, '2017-02-13 11:00:07', 'minha cachorra escondeu o outro pé no quintal achando que era um novo brinquedo.', 'MINHA CADEIRA VEIO SEM UM PÉ.', 8),
